import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter } from "react-router-dom";
import App from "./App";

// BroswerRouter : to keep the url in sync with the view. we can have a clean URL with this.
ReactDOM.render(
    <BrowserRouter>
        <App />    
    </BrowserRouter>,

    document.getElementById('root')
);
